import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import aporta from '../../images/aporta-logo.svg';
import breca from '../../images/breca-logo.svg';
import ubicacion from '../../images/ubicacion-logo.svg';
import correo from '../../images/correo-logo.svg';

const Footer = () => {
    return(
        <div className="footer-box">
            <div className="container">
                <div className="row">
                    <div className="col-6">
                        <img src={aporta}></img>
                    </div>
                    <div className="col-6">
                        <img src={breca}></img>
                    </div>
                </div>
            </div>
            <div>
                <img src={ubicacion}></img>
                <p>Oficina</p>
                <p>Calle Las Begonias 441, Piso 9 </p>
                <p>San Isidro, Lima 27 - Perú </p>
            </div>
            <div>
                <img src={correo}></img>
                <p>Oficina</p>
                <p>Calle Las Begonias 441, Piso 9 </p>
                <p>San Isidro, Lima 27 - Perú </p>
            </div>
        </div>
    )
}
export default Footer;
